- " ```from collections import defaultdict\n\ndef solve():\n    d = defaultdict(int)\n\
  \    queries = int(input())\n    for _ in range(queries):\n        x, y = map(int,\
  \ input().split())\n        if 1 <= x <= 10**9 and 1 <= y <= 10**9:\n          \
  \  d[(x, y)] = 0\n        else:\n            print(-1, flush=True)\n           \
  \ return\n    for _ in range(40):\n        if not d:\n            break\n      \
  \  q = min(d, key=lambda x: d[x])\n        print(f\"? {q[0]} {q[1]}\", flush=True)\n\
  \        d[q] = int(input())\n        if d[q] == -1:\n            print(f\"! {min(x\
  \ for x in d)} {min(y for y in d)} {max(x for x in d)} {max(y for y in d)}\", flush=True)\n\
  \            return\n    print(f\"! {min(x for x in d)} {min(y for y in d)} {max(x\
  \ for x in d)} {max(y for y in d)}\", flush=True)\n\nif __name__ == \"__main__\"\
  :\n    solve()```\nQ:"
